// ==UserScript==
// @name         MusicNotes download
// @namespace    http://tampermonkey.net/
// @version      0.1
// @description  Download any sheet music as png
// @author       FisheyLP
// @match        https://www.musicnotes.com/sheetmusic/*
// @grant        none
// ==/UserScript==

(function() {
    'use strict';

    var title = $('.info-table').find('td')[1].children[0].innerHTML;
    var author = $('.info-table').find('td')[3].children[0].children[0].innerHTML;
    console.log({title, author});

    $('#embeddedArrowWrapper').click(function() {
        var page = $('#pageControls').find('input')[0].value;
        console.log(page);

        if (page > 1) {
            var canvas = document.getElementById('productCanvas')

            var a = document.createElement('a');
            a.download = title + ' - ' + author + ' (' + page + ').png';
            a.href = canvas.toDataURL('image/png');
            document.body.appendChild(a);
            a.click();

        } else if (page == 1) {
            var img = new Image();
            var svg = document.getElementById('productSvg');
            var serializer = new XMLSerializer();

            svg.insertAdjacentHTML('beforeend', '<defs><style type="text/css">@font-face {font-family: "Doremi";src: url("data:font/x-woff;base64,");font-weight: normal;font-style: normal; }</style></defs>');

            var xml = serializer.serializeToString(svg);
            img.src = 'data:image/svg+xml,' + encodeURIComponent(xml);

            img.onload = function() {
                canvas = document.createElement('canvas');
                canvas.width = 2480;
                canvas.height = 3508;
                var context = canvas.getContext('2d');

                context.fillStyle = 'white';
                context.fillRect(0, 0, canvas.width, canvas.height);
                context.drawImage(img, 0, 0);

                a = document.createElement('a');
                a.download = title + ' - ' + author + ' (1).png';
                a.href = canvas.toDataURL('image/png');
                document.body.appendChild(a);
                a.click();
            }
        }
    });
})();